import React from "react";
import { useState } from "react";
function App() {
  const [count, setCount] = useState(0);
  function plusCount() {
    setCount((count = count + 1));
  }
  return (
    <div>
      <div>{count}</div>
      <div>
        <button onClick={plusCount}>+</button>
        <button>-</button>
      </div>
    </div>
  );
}

export default App;
